  const aoNovoColaboradorAdicionado = (colaborador)=>{
    console.table(colaborador)
    setColaboradores([...colaboradorers,colaborador])
  }
  return (
    <div className="App">
      <Banner />
      <Formulario aoColaboradorCadastrado={colaborador =>aoNovoColaboradorAdicionado(colaborador)}/>

    </div>

  );
}

